svg.script:
    frame = 0;
    function doOneStep() {
	t = document.getElementById("layer2"); 
	t.setAttribute("cy", frame+100);    /* Change la position verticale de cet lment */
 	t.setAttribute("opacity", (100-frame)/100); /* L'opacit varie de 1.0  0.0 */
        t.setAttribute("width", (frame+100)); /* Essayer de changer la grandeur  */

	if (frame++ <= 100)
	    setTimeout(doOneStep, 40);
    }

    doOneStep(); /* dmarre l'animation */
